import React from 'react'
import { useParams, Link, useNavigate } from 'react-router-dom'
import { projects } from '../data/projects'
import {
  Box,
  Typography,
  Breadcrumbs,
  Button,
  Stack,
  Divider,
} from '@mui/material'
import HomeIcon from '@mui/icons-material/Home'
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth'
import LocationOnIcon from '@mui/icons-material/LocationOn'

const slugify = (text) =>
  text.toLowerCase().replace(/[^\w ]+/g, '').replace(/ +/g, '-')

const projectsWithSlugs = projects.map((p) => ({
  ...p,
  slug: slugify(p.title),
}))

const ProjectDetail = () => {
  const { slug } = useParams()
  const project = projectsWithSlugs.find((p) => p.slug === slug)
  const navigate = useNavigate()

  if (!project) {
    return (
      <Box
        sx={{
          minHeight: '80vh',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          px: 3,
        }}
      >
        <Typography variant="h4" color="error" gutterBottom>
          Project Not Found
        </Typography>
        <Typography variant="body1" sx={{ mb: 3 }}>
          Sorry, we couldn&apos;t find the project you were looking for.
        </Typography>
        <Button
          variant="contained"
          color="primary"
          onClick={() => navigate('/')}
          size="large"
          sx={{ borderRadius: 3 }}
        >
          Back to Home
        </Button>
      </Box>
    )
  }

  return (
    <Box
      sx={{
        maxWidth: 960,
        mx: 'auto',
        p: { xs: 3, md: 6 },
        backgroundColor: 'transparent',
        minHeight: '100vh',
        animation: 'fadeIn 0.6s ease forwards',
        '@keyframes fadeIn': {
          from: { opacity: 0, transform: 'translateY(12px)' },
          to: { opacity: 1, transform: 'translateY(0)' },
        },
      }}
    >
      {/* Breadcrumbs */}
      <Breadcrumbs
        separator="›"
        aria-label="breadcrumb"
        sx={{
          mb: 4,
          color: '#6a4f7d',
          fontWeight: 600,
          '& a': {
            color: '#6a4f7d',
            textDecoration: 'none',
            fontWeight: 600,
            display: 'flex',
            alignItems: 'center',
            '&:hover': { color: '#8f6cad' },
          },
          '& .MuiTypography-root': {
            color: '#a287b8',
            fontWeight: 700,
          },
        }}
      >
        <Link to="/">
          <HomeIcon fontSize="small" sx={{ mr: 0.5 }} />
          Home
        </Link>
        <Link to="/#projects">Projects</Link>
        <Typography>{project.title}</Typography>
      </Breadcrumbs>

      {/* Large Image - full width, no crop */}
      <Box
        component="img"
        src={project.image}
        alt={project.title}
        sx={{
          width: '100%',
          height: 'auto',
          borderRadius: 4,
          boxShadow: '0 12px 30px rgba(90, 62, 97, 0.15)',
          mb: 5,
          objectFit: 'contain',
          userSelect: 'none',
          pointerEvents: 'none',
          transition: 'transform 0.4s ease',
          '&:hover': {
            transform: 'scale(1.02)',
          },
        }}
      />

      {/* Project Info */}
      <Box>
        <Typography
          variant="h3"
          sx={{
            fontWeight: 800,
            color: '#5a3e61',
            mb: 3,
            letterSpacing: 1.2,
            lineHeight: 1.2,
          }}
        >
          {project.title}
        </Typography>

        <Stack direction={{ xs: 'column', sm: 'row' }} spacing={4} mb={4}>
          <Stack direction="row" spacing={1} alignItems="center" sx={{ color: '#8f6cad' }}>
            <CalendarMonthIcon fontSize="medium" />
            <Typography variant="subtitle1" color="text.secondary">
              {project.date}
            </Typography>
          </Stack>
          <Stack direction="row" spacing={1} alignItems="center" sx={{ color: '#8f6cad' }}>
            <LocationOnIcon fontSize="medium" />
            <Typography variant="subtitle1" color="text.secondary">
              {project.location}
            </Typography>
          </Stack>
        </Stack>

        <Divider sx={{ mb: 4, borderColor: '#cdb4db' }} />

        <Typography
          variant="body1"
          sx={{
            fontWeight: 400,
            color: '#3a2f3b',
            lineHeight: 1.8,
            fontSize: '1.125rem',
            whiteSpace: 'pre-line',
            letterSpacing: 0.2,
          }}
          dangerouslySetInnerHTML={{ __html: project.description }}
        />

        <Box sx={{ mt: 6 }}>
          <Button
            variant="outlined"
            onClick={() => navigate('/#projects')}
            sx={{
              borderRadius: 4,
              color: '#5a3e61',
              borderColor: '#5a3e61',
              fontWeight: 700,
              fontSize: '1rem',
              px: 4,
              py: 1.5,
              transition: 'all 0.3s ease',
              '&:hover': {
                backgroundColor: '#5a3e61',
                color: '#fff',
                borderColor: '#5a3e61',
              },
            }}
          >
            ← Back to Projects
          </Button>
        </Box>
      </Box>
    </Box>
  )
}

export default ProjectDetail
